var levelData = [{"id":3,"name":"Уровень 1","fullname":"1-й уровень контроля","description":"Уровень контроля Президента организации и его заместителей.\nОбъектами контроля проектной деятельности являются проекты, контрольные точки, относящиеся к уровню контроля руководства организации.\nКонтроль осуществляется посредством запроса информации по финансам и срокам, регламентированных периодических отчетов и оперативных запросов отдельных сегментов информации по проектной деятельности организации"},{"id":4,"name":"Уровень 2","fullname":"2-й уровень контроля","description":"Уровень контроля Проектного комитета.\nОбъектами контроля проектной деятельности являются проекты, контрольные точки, относящиеся к уровню контроля Проектного комитета организации.\nКонтроль осуществляется посредством проведения ежемесячных заседаний Проектного комитета и внеплановых ПК с рассмотрением на них всего портфеля проектов организации, состояния их основных показателей и рассмотрения вопросов и рисков, вынесенных на ПК. Также должны использоваться информационные сводки и др. дополнительные отчеты,  позволяющие получить подробную картину по портфелю проектов организации"},{"id":20003,"name":"Уровень 3","fullname":"3-й уровень контроля","description":"Уровень контроля Центрального офиса управления проектами организации\nОбъектами контроля проектной деятельности являются проекты, контрольные точки, относящиеся к уровню контроля Центрального офиса управления проектами организации \nКонтроль осуществляется посредством проведения ежемесячных циклов сбора отчетности на Проектный комитет, еженедельным контролем состояния контрольных точек по проектам, основных показателей проектов. "},{"id":20004,"name":"Уровень 4","fullname":"4-й уровень контроля","description":"Уровень контроля Функционального офиса управления проектами организации.\nОбъектами контроля проектной деятельности являются проекты, контрольные точки, относящиеся к уровню контроля Функционального офиса управления проектами организации.\nКонтроль осуществляется посредством проведения ежемесячных циклов сбора отчетности на Проектный комитет, еженедельным контролем состояния контрольных точек по проектам организации, основных показателей проектов организации. Также должен использоваться поэтапный, предварительный и выборочный контроль проектов организации"}];
